$(function(){
    $('.js-basket-count').each(function(){
        var $val = $(this).find('.js-basket-count-sum');
        console.log($val)
        $(this).find('.js-basket-count-btn').on('click', function(e){
            e.preventDefault();
            if ($(this).text() == '+') {
                $val.text(Number($val.text()) + 1);
            } else {
                var val = Number($val.text()) - 1;
                $val.text(val < 1 ? 1 : val);
            }
        });
    });
});
